(547, 'Root of Bomax 1 lbs', 'root-of-bomax-1-lbs', 'Bombax, like other trees of the genus Bombax, is commonly known as cotton tree. More specifically, it is sometimes known as Malabar silk-cotton tree; red silk-cotton; red cotton tree; or ambiguously as silk-cotton or kapok, both of which may also refer to Ceiba pentandra.\n\nThis Asian tropical tree has a straight tall trunk and its leaves are deciduous in winter. Red flowers with 5 petals appear in the spring before the new foliage. It produces a capsule which, when ripe, contains white fibres like cotton. Its trunk bears spikes to deter attacks by animals. Although its stout trunk suggests that it is useful for timber, its wood is too soft to be very useful.', 7, 3.29, 6, 2.49, 3.29, 3.29, '568513688351', 50, 1, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 993, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/993/Root5.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/993/conversions/Root5-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 10:24:24', '2021-12-23 16:57:39', NULL, NULL, 0, 0, NULL, NULL),
(548, 'Floriculture Greens Purple Turnip Shalgam 1lbs', 'floriculture-greens-purple-turnip-shalgam-1lbs', 'Sold By Floriculture Greens Provide 100% Best Quality Hybrid Seeds Of Vegetable Plants. Turnip Produces Leafy Stem And 8 To 12 Small, Light Green Leaves That Grow Around It. Main Stem Can Reach 12 To 14 Inches In Height. Turnip Produces Roundish Root With Thin Taproot On Its End. Root Is Covered With White Or Green Skin Which Usually Changes The Color Into Purple On The Parts Of Root Exposed To The Sun.', 7, 2.59, 6, 2, 2.59, 2.59, '213513651999', 50, 1, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 995, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/995/Root10.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/995/conversions/Root10-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 10:30:25', '2021-12-23 16:57:35', NULL, NULL, 0, 0, NULL, NULL),
(549, 'Ginger 1lbs', 'ginger-1lbs', 'Ginger is a reed like herb that is grown for its pungent, spicy underground stems or rhizomes. The edible portion is the rhizome which is rough and knotty in appearance.', 7, 2.19, 6, 1.59, 2.19, 2.19, '254789632147', 50, 1, 0, NULL, 'publish', 'simple', '1 lbs', NULL, NULL, NULL, '{\"id\": 996, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/996/Root9.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/996/conversions/Root9-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 10:32:39', '2021-12-23 16:57:33', NULL, NULL, 0, 0, NULL, NULL),
(550, 'Organic Sweet Potato 1lbs', 'organic-sweet-potato-1lbs', 'The sweet potato or sweetpotato is a dicotyledonous plant that belongs to the bindweed or morning glory family, Convolvulaceae. Its large, starchy, sweet-tasting, tuberous roots are used as a root vegetable. The young shoots and leaves are sometimes eaten as greens.', 7, 2.99, 6, NULL, 2.99, 2.99, '124578963254', 50, 1, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 997, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/997/Root8.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/997/conversions/Root8-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 10:37:44', '2021-12-23 16:57:30', NULL, NULL, 0, 0, NULL, NULL),
(551, 'Organic Cassava 1lbs', 'organic-cassava-1lbs', 'The cassava is a very useful and important plant in places like South America, Indonesia, and especially in Africa, where my distant basenji cousins live.  When it grows, it makes a bunch of tuber-type roots under the ground, sort of like potatoes.  This is the part of the plant that is eaten the most, but you can also eat the cassava leaves or feed them to your cattle and goats.', 7, 2.49, 6, NULL, 2.49, 2.49, '245789635784', 50, 1, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 999, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/999/Root6.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/999/conversions/Root6-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 10:42:42', '2021-12-23 16:57:27', NULL, NULL, 0, 0, NULL, NULL),
(552, 'Wild Yam 1lbs', 'wild-yam-1lbs', 'Wild Yam is one of a thousand of herbs out there that can benefit your horse, but each herb, despite having similar capabilities regarding inflammation, can be quite different in their overall mechanism of action.  Thus, no one herb is right or beneficial for each and every horse.  Wild Yam is one that is quite unique and an herb that I have found to have tremendous value in the right horse for a variety of reasons and issues.', 7, 2, 6, NULL, 2.00, 2.00, '569874125478', 50, 1, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 1000, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1000/Root7.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1000/conversions/Root7-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:20:16', '2021-12-23 16:57:24', NULL, NULL, 0, 0, NULL, NULL),
(553, 'Cucumber', 'cucumber-2', 'Cucumber is a widely cultivated plant in the gourd family, Cucurbitaceae. It is a creeping vine that bears cucumiform fruits that are used as vegetables. There are three main varieties of cucumber: slicing, pickling, and seedless. Within these varieties, several cultivars have been created.', 7, 2.59, 6, NULL, 2.59, 2.59, '568741239654', 50, 1, 0, NULL, 'publish', 'simple', '2 lbs', NULL, NULL, NULL, '{\"id\": 1001, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1001/Marrow1.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1001/conversions/Marrow1-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:22:40', '2021-12-23 16:57:19', NULL, NULL, 0, 0, NULL, NULL),
(554, 'Ash Gourd 2lbs', 'ash-gourd-2lbs', 'Ash gourd, scientifically termed Benincasa hispida, goes by several vernacular names such as “Petha” in Hindi, “Boodida Gummadi” in Telugu, “Neer Pooshnikkai” in Tamil and “Kumbalam” in Malayalam.\n\nThis green vegetable has been well-regarded for its significant medicinal values since ancient times and is widely documented in Ayurvedic texts. Today, it continues to be heralded for its immense health benefits and is widely incorporated, in popular local cuisine across India, as well as in alleviating illnesses of the stomach, liver and skin, to name a few.', 7, 3.1, 6, 2.69, 3.10, 3.10, '256897412365', 50, 1, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1002, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1002/Marrow2.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1002/conversions/Marrow2-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:26:10', '2021-12-23 16:57:15', NULL, NULL, 0, 0, NULL, NULL),
(555, 'Cherry Tomato 1lbs', 'cherry-tomato-1lbs', 'Tomatoes are loaded with a substance called lycopene. It gives them their bright red color and helps protect them from the ultraviolet rays of the sun. In much the same way, it can help protect your cells from damage. Tomatoes also have potassium, vitamins B and E, and other nutrients.', 7, 2, 6, NULL, 2.00, 2.00, '564134569785', 49, 1, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 1003, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1003/Marrow3.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1003/conversions/Marrow3-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:30:05', '2021-12-23 16:57:12', NULL, NULL, 0, 0, NULL, NULL),
(556, 'Red Capsicum 1lbs', 'red-capsicum-1lbs', 'A wonderful combination of tangy taste and crunchy texture, sweet Capsicum are the ornaments of the vegetable world with their beautifully shaped glossy exterior that comes in a wide array of vivid colors ranging from red. Capsicum is not only an excellent source of carotenoids, but also a source of over 30 different members of the carotenoid nutrient family.It also contains vitamin C and E.', 7, 4.59, 6, 3, 4.59, 4.59, '265478954752', 50, 1, 0, NULL, 'publish', 'simple', '1 lbs', NULL, NULL, NULL, '{\"id\": 1004, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1004/Marrow4.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1004/conversions/Marrow4-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:31:58', '2021-12-23 16:57:08', NULL, NULL, 0, 0, NULL, NULL),
(557, 'Green Capsicum 1lbs', 'green-capsicum-1lbs', 'Green capsicums are picked when ripe and have an all-over green appearance.A fresh, crisp green capsicum is a tasty vegetable that can be a regular part of your healthy eating plan. This vegetable is low in calories and contains 0 grams of fat and a good supply vitamins and minerals. Their mildly sweet flavor makes green bell peppers versatile enough to include a wide variety of nutritious recipes.', 7, 3.49, 6, NULL, 3.49, 3.49, '256987412365', 50, 1, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 1005, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1005/Marrow5.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1005/conversions/Marrow5-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:34:19', '2021-12-23 16:57:04', NULL, NULL, 0, 0, NULL, NULL),
(558, 'Collard Greens 2lbs', 'collard-greens-2lbs', 'The dark, vibrant green leaves of collard greens are packed with vitamins, minerals and soluble fiber. They’re also extremely satisfying to cook with, and lend themselves well to olive oil braising, soups, and slow cooking. A hardy green with a mildly cabbagy flavor, collards stand up well to longer cooking times, which softens the texture and mellows the flavor. They pair deliciously with assertive flavors, such as smokiness or meatiness (pancetta, bacon, chorizo, kielbasa, any cured meat), sweetly pungent aromatics (garlic, onions, fresh ginger,) an acid or anything spicy (vinegar, lemon juice, hot sauce, red pepper flakes, chile or curry paste, minced hot peppers) or anything creamy (think heavy cream, sour cream, and goat cheese.)', 7, 1.99, 6, NULL, 1.99, 1.99, '256547896541', 50, 1, 0, NULL, 'publish', 'simple', '2 lbs', NULL, NULL, NULL, '{\"id\": 1006, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1006/Leafy_green1.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1006/conversions/Leafy_green1-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:41:23', '2021-12-23 16:57:01', NULL, NULL, 0, 0, NULL, NULL),
(559, 'Coriander Bunch 250 g', 'coriander-bunch-250-g', 'If you are into dressing your food well, Coriander must top your grocery list. Coriander not just make the food look appealing but also adds a distinct flavour to the food. It is widely used for preparations of sides, chutneys and sauces too. Buy Coriander Bunch (Approx 50 g - 200 g) online now.', 7, 1.49, 6, NULL, 1.49, 1.49, '569874521458', 49, 1, 0, NULL, 'publish', 'simple', '250 g', NULL, NULL, NULL, '{\"id\": 1007, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1007/Leafy_green2.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1007/conversions/Leafy_green2-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:43:06', '2021-12-23 16:56:57', NULL, NULL, 0, 0, NULL, NULL),
(560, 'Parsley 1lbs', 'parsley-1lbs', 'Fresh, slightly spicy and above all very healthy: parsley is one of the classic herbs in the kitchen. No soup, sauce or pasta without parsley, whose full flavour with a hint of pepper is always recognisable. What many don\'t know is that this fresh herb is packed with vitamins and minerals, such as vitamin K, which assists the body in absorbing calcium.', 7, 2.29, 6, NULL, 2.29, 2.29, '598741256321', 50, 1, 0, NULL, 'publish', 'simple', '1lbs', NULL, NULL, NULL, '{\"id\": 1008, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1008/Leafy_green3.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1008/conversions/Leafy_green3-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 11:48:57', '2021-12-23 16:56:52', NULL, NULL, 0, 0, NULL, NULL),
