(568, 'Garden asparagus 2lbs', 'garden-asparagus-2lbs', 'Garden asparagus, folk name sparrow grass, scientific name Asparagus officinalis, is a perennial flowering plant species in the genus Asparagus. Its young shoots are used as a spring vegetable. It was once classified in the lily family, like the related Allium species, onions and garlic.', 7, 3.89, 6, 3.29, 3.89, 3.89, '6352114578963', 50, 1, 0, NULL, 'publish', 'simple', '2 lbs', NULL, NULL, NULL, '{\"id\": 1016, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1016/Edible-plant1.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1016/conversions/Edible-plant1-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-29 12:13:05', '2021-12-23 16:54:59', NULL, NULL, 0, 0, NULL, NULL),
