(734, 'Kraft Mozzarella', 'kraft-mozzarella', 'Cheese may be a foodstuff , derived from milk and produced in wide ranges of flavors, textures and forms by coagulation of the milk protein casein. It comprises proteins and fat from milk, usually the milk of cows, buffalo, goats, or sheep. During production, the milk is typically acidified and therefore the enzymes of rennet (or bacterial enzymes with similar activity) are added to cause the milk proteins (casein) to coagulate. The solids (curd) are separated from the liquid (whey) and pressed into final form. Some cheeses have aromatic molds on the rind, the outer layer, or throughout. Most cheeses melt at cooking temperature.', 7, 1.95, 6, NULL, 1.95, 1.95, '489651631', 50, 1, 0, NULL, 'publish', 'simple', '200g', NULL, NULL, NULL, '{\"id\": 1187, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1187/Cheese1.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1187/conversions/Cheese1-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-09-30 13:37:56', '2021-12-22 17:09:24', NULL, NULL, 0, 0, NULL, NULL),
