(831, 'Squid Fish', 'squid-fish', 'Squid are cephalopods in the superorder Decapodiformes with elongated bodies, large eyes, eight arms and two tentacles. ... Squid diverged from other cephalopods during the Jurassic and occupy a similar role to teleost fish as open water predators of similar size and behaviour.', 7, 11.88, 6, 10.99, 11.88, 11.88, '256321458974', 50, 1, 0, NULL, 'publish', 'simple', '2 lbs', NULL, NULL, NULL, '{\"id\": 1283, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1283/Shellfish1.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1283/conversions/Shellfish1-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 18:15:17', '2021-12-22 16:57:02', NULL, NULL, 0, 0, NULL, NULL),
(832, 'Octopus Tentacles', 'octopus-tentacles', '100 grams of Octopus have approximately 29 grams of protein! It is also a perfect source of vitamin B6 and B12, selenium and iron. Here is Italian’s favourite recipe: Octopus and Potato Salad! Boil octopus in a large pot for 30 minutes. In another pot, boil whole and unpeeled potatoes for 20 minutes. Peel the potatoes, cut into cubes. Once the octopus tentacles are cooked, cut them into chunks. Toss the octopus and potatoes together with the chopped parsley, lemon juice, olive oil, and olive slices. Spice with salt and pepper', 7, 15.3, 6, NULL, 15.30, 15.30, '256321458965', 50, 1, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1284, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1284/Shellfish2.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1284/conversions/Shellfish2-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 18:18:35', '2021-12-22 16:56:59', NULL, NULL, 0, 0, NULL, NULL),
(833, 'Crayfish', 'crayfish', 'Crayfish are freshwater crustaceans resembling small lobsters. In some locations, they are also known as crawfish, craydids, crawdaddies, crawdads, freshwater lobsters, mountain lobsters, rock lobsters, mudbugs, or yabbies. Taxonomically, they are members of the superfamilies Astacoidea and Parastacoidea.', 7, 14.29, 6, 12.3, 14.29, 14.29, '256987541256', 50, 1, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1285, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1285/Shellfish3.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1285/conversions/Shellfish3-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 18:20:07', '2021-12-22 16:56:56', NULL, NULL, 0, 0, NULL, NULL),
(834, 'Black Oyster', 'black-oyster', 'The black oyster mushroom (Shimofuri), also known as the black oyster, black king trumpet, or the black pearl is a unique hybrid that starting to gain notoriety. You\'ve probably heard about oyster mushrooms by now. ... This mushroom was developed by crossbreeding European oyster mushrooms with Japanese oyster mushrooms.', 7, 20.29, 6, 18.99, 20.29, 20.29, '256321457896', 50, 1, 0, NULL, 'publish', 'simple', '2lbs', NULL, NULL, NULL, '{\"id\": 1286, \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1286/Shellfish4.jpg\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1286/conversions/Shellfish4-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-10-02 18:22:08', '2021-12-22 16:56:53', NULL, NULL, 0, 0, NULL, NULL),
