(947, 'Combo banner one', 'combo-banner-01', 'But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?', 8, 15, 7, NULL, 15.00, 15.00, 'sku-comb-100', 100, 1, 0, NULL, 'publish', 'simple', '1pc', '', '', '', '{\"id\": \"1683\", \"original\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1683/Combo_banner_02.png\", \"thumbnail\": \"https://pickbazarlaravel.s3.ap-southeast-1.amazonaws.com/1683/conversions/Combo_banner_02-thumbnail.jpg\"}', NULL, '[]', NULL, '2021-01-05 18:57:22', '2021-01-06 09:17:48', 5, 3, 1, 0, NULL, NULL),
